// Export flag categories for filtering
export const flagCategories = [
  "Temporary",
  "Scripts", 
  "Game Progress",
  "Gym Leaders & Elite Four",
  "Badges",
  "Towns & Cities",
  "Landmarks",
  "Hidden Items",
  "Item Balls",
  "Event Visibility",
  "Trainer Registration",
  "System",
  "Daily",
  "Mystery Events",
  "Move Tutors",
  "Unused"
];

// Export convenience functions
export function getFlagsByCategory(category) {
  return comprehensiveEmeraldFlags.filter(flag => flag.category === category);
}

export function getFlagByName(name) {
  return comprehensiveEmeraldFlags.find(flag => flag.flag === name);
}

export function getFlagByValue(value) {
  return comprehensiveEmeraldFlags.find(flag => flag.value === value);
}

export function getUnusedFlags() {
  return comprehensiveEmeraldFlags.filter(flag => flag.unused);
}

export function getComputedFlags() {
  return comprehensiveEmeraldFlags.filter(flag => flag.computed);
}

// Create flagsByCategory object for backwards compatibility
export const flagsByCategory = flagCategories.reduce((acc, category) => {
  acc[category] = comprehensiveEmeraldFlags.filter(flag => flag.category === category);
  return acc;
}, {});

// Create unusedFlags array for backwards compatibility
export const unusedFlags = comprehensiveEmeraldFlags.filter(flag => flag.unused);